import React from "react";
import './App.css';
const Resultado =({dato})=>
{
    return(
<>   
     <div className="App">
            < h6>Nombre:{dato.nombres}</h6>
             <h6>Apellido:{dato.apellidos}</h6>
             <h6>Sexo:{dato.sexo}</h6>
             <h6>DUI:{dato.dui}</h6>
             <h6>fechaNacimiento: {dato.fechaNacimiento}</h6>
             <h6>direccion:{dato.direccion}</h6>
             <h6>municipio:{dato.municipio}</h6>
             <h6>departamento:{dato.departamento}</h6>

    </div>
</>
    );

}

export default Resultado
